import urllib.parse

def parse_url(url):
    try:
        parsed_url = urllib.parse.urlparse(url)
    except ValueError:
        return 'Invalid URL'
    if not all([parsed_url.scheme, parsed_url.netloc]):
        return ''
    queries = urllib.parse.parse_qs(parsed_url.query)
    return {'scheme': parsed_url.scheme, 'netloc': parsed_url.netloc, 'path': parsed_url.path, 'params': queries}

